import React from "react";
import "../stylesheets/inicio.css";

const Inicio = () => {
  return (
    <div className="box">
      <div className="group">
        <img className="image" src={require("../imagenes/image-1.png")} />
        <p className="GEE-sistema-para">
          <span className="text-wrapper">
            GEE
            <br />
          </span>
          <span className="span">Sistema Para Gestion De Eventos</span>
        </p>
        <img className="img" src={require("../imagenes/image-2.png")} />
      </div>
    </div>
  );
};

export default Inicio
